import React from 'react';
import { Routes, Route, Navigate } from 'react-router-dom';
import { useAuth } from './context/AuthContext';

// Layout
import Layout from './components/Layout/Layout';

// Pages
import Dashboard from './pages/Dashboard/Dashboard';
import Login from './pages/Auth/Login';
import Register from './pages/Auth/Register';
import Strategies from './pages/Strategies/Strategies';
import StrategyDetail from './pages/Strategies/StrategyDetail';
import Settings from './pages/Settings/Settings';
import UserProfile from './pages/UserProfile/UserProfile';
import DistributorNetwork from './pages/Distributor/DistributorNetwork';
import CommissionReports from './pages/Distributor/CommissionReports';
import CommissionPage from './pages/Distributor/CommissionPage';
import AdminPanel from './pages/Admin/AdminPanel';
import NotFound from './pages/NotFound/NotFound';
import Exchanges from './pages/Exchanges/Exchanges';
import PortfolioPage from './pages/Portfolio/PortfolioPage';
import MarketPage from './pages/Market/MarketPage';
import TradePage from './pages/Trading/TradePage';

// Private Route component
const PrivateRoute = ({ children, requiredRoles = [] }) => {
  const { isAuthenticated, user } = useAuth();

  if (!isAuthenticated) {
    return <Navigate to="/login" replace />;
  }

  if (requiredRoles.length > 0 && !requiredRoles.some(role => user.roles.includes(role))) {
    return <Navigate to="/unauthorized" replace />;
  }

  return children;
};

function App() {
  return (
    <Routes>
      {/* Public routes */}
      <Route path="/login" element={<Login />} />
      <Route path="/register" element={<Register />} />

      {/* Protected routes */}
      <Route path="/" element={
        <PrivateRoute>
          <Layout />
        </PrivateRoute>
      }>
        <Route index element={<Dashboard />} />
        <Route path="strategies" element={<Strategies />} />
        <Route path="strategies/:id" element={<StrategyDetail />} />
        <Route path="exchanges" element={<Exchanges />} />
        <Route path="portfolio" element={<PortfolioPage />} />
        <Route path="markets" element={<MarketPage />} />
        <Route path="trade" element={<TradePage />} />
        <Route path="settings" element={<Settings />} />
        <Route path="profile" element={<UserProfile />} />

        {/* Distributor routes */}
        <Route path="network" element={
          <PrivateRoute requiredRoles={['DISTRIBUTOR', 'MASTER_DISTRIBUTOR', 'ADMIN']}>
            <DistributorNetwork />
          </PrivateRoute>
        } />
        <Route path="commissions" element={
          <PrivateRoute requiredRoles={['DISTRIBUTOR', 'MASTER_DISTRIBUTOR', 'ADMIN']}>
            <CommissionPage />
          </PrivateRoute>
        } />
        <Route path="commission-reports" element={
          <PrivateRoute requiredRoles={['DISTRIBUTOR', 'MASTER_DISTRIBUTOR', 'ADMIN']}>
            <CommissionReports />
          </PrivateRoute>
        } />

        {/* Admin routes */}
        <Route path="admin" element={
          <PrivateRoute requiredRoles={['ADMIN']}>
            <AdminPanel />
          </PrivateRoute>
        } />
      </Route>

      {/* Catch-all route */}
      <Route path="*" element={<NotFound />} />
    </Routes>
  );
}

export default App;
